export default function MoneyBook() {
  return (
    <div className="h-screen w-screen bg-gradient-to-r from-green-100 to-white flex items-start justify-end p-8">
      <button className="px-6 py-3 bg-green-500 text-white font-semibold rounded-lg shadow-md hover:bg-green-600 transition duration-300 transform hover:scale-105 hover:shadow-lg">
        Add New Book
      </button>
    </div>
  );
}
